(2, 'TỔNG QUAN', 'ABOUT US', '<p style="text-align:center"><span style="font-size:16px"><span style="font-family:arial,helvetica,sans-serif"><strong><em>Kính thưa quý khách !</em></strong></span></span></p>\r\n\r\n<p><span style="font-size:16px"><span style="font-family:arial,helvetica,sans-serif">&nbsp;</span><span style="line-height:1.6">&nbsp;&nbsp;</span><span style="line-height:1.6">&nbsp;&nbsp;&nbsp;</span><span style="line-height:1.6"><strong>V</strong>ốn&nbsp;là biểu tượng của nước ta, hình ảnh cây tre đã trở thành thân thiện với mỗi người Việt&nbsp;Nam. Không chỉ vậy, những sản phẩm được sản xuất từ tre đã trở thành thông dụng trong mỗi nếp sống gia đình.</span><br />\r\nTừ những tiện ích đó, không chỉ ở Việt&nbsp;Nam mà cả&nbsp;&nbsp;ngước ngoài, sử dụng que tre trong chế biến thực phẩm&nbsp;&nbsp;đã được thị hiếu chấp nhận&nbsp;như một tập quán quen thuộc hằng ngày, đặc biệt là trong ngành chế biến thủy hải sản.<br />\r\nXác định được điều đó, công ty chúng tôi từng bước đi vào chuyên môn trong lĩnh vực sản xuất&nbsp;&nbsp;que xiên tre chuyên dùng trong chế biến thủy sản&nbsp;để mang lại cho khách hàng&nbsp;sự phục vụ tận tình, chuyên nghiệp với quan điểm :&nbsp;&nbsp;<strong>TẤT CẢ CHO CHẤT LƯỢNG</strong>&nbsp;.<br />\r\n<strong>Q</strong>ua&nbsp;15 năm sản xuất, chúng tôi từng bước đầu tư xây dựng&nbsp;nhà xưởng,&nbsp;đổi mới thiết bị và&nbsp;nâng cao tay nghề cho công nhân. Nhẫn nại học hỏi và tận tụy trong công việc để&nbsp;&nbsp;tìm ra phương pháp sản xuất tối ưu&nbsp;sản phẩm tốt và giá thành&nbsp;hợp lý để&nbsp;đảm bảo giá trị sử dụng que tre của khách hàng.<br />\r\n<strong><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Thưa Quý Khách.</em></strong><br />\r\n<strong>P</strong>hải đúng ngay từ đầu, đó là điều chúng tôi đã làm khi mạnh dạn đầu tư vào&nbsp;trồng và khai thác nguyên liệu. Công nhân chúng tôi được hướng dẫn cách đốn hạ những cây tre đủ chất lượng làm que và phải biết làm cách nào để bảo quản nguyên liệu tốt nhất. Chúng tôi quí trọng từng thanh nguyên liệu, xử lý tốt các tình huống sản xuất để tạo ra sản phẩm cho xã hội, mang lại lợi ích cho công ty và quyền&nbsp;lợi vật chất cho mọi người.<br />\r\n<strong>N</strong>goài ra, chúng tôi luôn có chính sách ưu tiêncho người khuyết tật tham gia lao động sản xuất. Người khuyết tật khi lao động trong ty chúng tôi sẽ hưởng được chính sách ưu tiên hơn lao động bình thường.<br />\r\n<strong>Đ</strong>ể đi đến chuyên nghiệp, còn phải phấn đầu rất nhiều về mọi mặt nhưng chúng tôi tự tin khi biết lắng nghe, học hỏi nhiều hơn từ những nhu cầu hợp lý&nbsp;của khách hàng cũng như những đóng góp hữu ích từ công nhân của mình để ngày càng chuyên nghiệp trong việc sản xuất que tre cho Ngành Thủy sản.<br />\r\n<strong>C</strong>húng tôi hy vọng và rất vinh dự khi được chọn là nhà cung cấp que tre để được đồng hành cùng sự lớn mạnh của quý khách.<br />\r\n&nbsp;<strong>X</strong>in biết ơn tất cả các khách hàng gần xa đã giúp đỡ chúng tôi từ những ngày đầu khởi nghiệp. Là nguồn động viên tinh thần cũng như vật chất rất&nbsp;quý giá&nbsp;để chúng tôi có được ngày hôm nay. Đó là ơn&nbsp; nghĩa trong giao thương và chúng tôi xin trân trọng<strong>TRI ÂN</strong>&nbsp;điều này.</span></p>\r\n', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<div class="rc" style="line-height: 20.7999992370605px;">\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its l