(2, 'Xiên cờ da xanh', 'updating', '<p style="text-align:center"><strong><img alt="" src="/images/ckfinder/img/XIENCODAXANH.JPG" style="height:227px; width:227px" /></strong></p>\r\n\r\n<p><span style="font-size:16px"><span style="color:#000080">Que tre xiên cờ da xanh được sản xuất theo qui trình thủ công kết hợp thiết bị công cụ hổ trợ. Được làm từ tre Tàu, lồ ô, tre mỡ ....</span></span></p>\r\n\r\n<p><span style="font-size:16px"><span style="color:#000080">Tách duy nhất một lớp cật tre để bảo đảm độ chứng chắc. Ưu điểm : Còn da màu xanh nhẹ của tre, cứng chắc. Nhược điểm : Sản xuất số lượng hạn chế, độ chính xác về kích cỡ bị hạn chế. Sản phẩm này thường dùng trong gim tôm cho thị trường Nhật Bản.</span></span></p>\r\n', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<div class="rc" style="line-height: 20.7999992370605px;">\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometime