CREATE TABLE IF NOT EXISTS `products` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `eTitle` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `img` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `sum` text CHARACTER SET utf8 NOT NULL,
  `eSum` text CHARACTER SET utf8 NOT NULL,
  `content` text CHARACTER SET utf8 NOT NULL,
  `eContent` text CHARACTER SET utf8 NOT NULL,
  `sId` int(11) NOT NULL DEFAULT '0',
  `Special` tinyint(1) NOT NULL DEFAULT '0',
  `ind` int(11) NOT NULL DEFAULT '0',
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `price` varchar(128) CHARACTER SET utf8 DEFAULT NULL,
  `ePrice` varchar(128) CHARACTER SET utf8 DEFAULT NULL,
  `sku` varchar(128) CHARACTER SET utf8 DEFAULT NULL,
  `status` varchar(128) CHARACTER SET utf8 DEFAULT NULL,
  `desc` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `eDesc` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `keyword` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `eKeyword` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=latin1 AUTO_INCREMENT=140 ;

